import React, { Component } from "react";

import "./../Tutorial/Tutorial.css";

export default class AboutStack extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3 className="title">The Stack</h3>
        <h6 className="bold-paragraph">First-In First-Out</h6>
        <img
          className="tutorial-image"
          src={require("./../../gifs/dragstartend.gif")}
        ></img>
        <button
          className="next"
          onClick={() => {
            this.props.close();
          }}
        >
          Close
        </button>
      </div>
    );
  }
}
